import React from 'react';

import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';

function WhoAreWe() {
  return (
    <Paper
      sx={{
        width: '100%',
        maxWidth: '300px',
        margin: '0 auto',
        position: 'relative',
        top: '-30px',
        padding: '2rem',
      }}
    >
      <Typography variant="body"> Hello world </Typography>
    </Paper>
  );
}

export default WhoAreWe;
